// SPDX-License-Identifier: MIT
pragma solidity ^0.8.7;
import "./IotaHeroUtil.sol";
import "./IotaHeroGameTokens.sol";

contract IotaHeroAdventure is IotaHeroUtil {
    IotaHeroGameTokens public tokens;
    using SafeMath for uint256;
    uint256 randomNonce = 0;
    uint256 adventureCounter = 0;

    enum AdventureType {
        MONSTER,
        EMPTY,
        MENTAL_TRAINING,
        PHYSICAL_TRAINING,
        FRIENDLY,
        ENVIRONMENT
    }

    struct Adventure {
        uint256 id;
        string name;
        uint256 xpRequirement;
        uint8 difficulty;
        string description;
        AdventureType adventureType;
    }
    Adventure[] public adventures;

    function setTokens(address tokensAddress) public onlyOwner {
        tokens = IotaHeroGameTokens(tokensAddress);
    }

    function getTokenAddress() public view returns (address) {
        return address(tokens);
    }

    function addAdventures(Adventure[] calldata _adventures) public onlyOwner {
        for (uint256 i = 0; i < _adventures.length; i++) {
            _addAdventure(_adventures[i]);
        }
    }

    function _addAdventure(Adventure calldata _adventure) internal {
        adventures.push(
            Adventure(
                adventureCounter,
                _adventure.name,
                _adventure.xpRequirement,
                _adventure.difficulty,
                _adventure.description,
                _adventure.adventureType
            )
        );
        adventureCounter++;
    }

    event AdventureCompleted(
        address indexed player,
        uint256 indexed heroId,
        string name,
        AdventureType adventureType,
        uint256 rand
    );

    function goAdventure(uint256 _heroId)
        external
        hasAccount
        onlyOwnerOf(_heroId)
    {
        Hero storage myHero = heroes[_heroId];
        require(
            heroIsReady(myHero),
            "Hero is not ready to go a new adventure yet.."
        );

        uint256 rand = _pseudoRandom(randomNonce) % 100;
        uint256 rand2 = _pseudoRandom(rand);
        Adventure storage adv = adventures[rand2 % adventures.length];
        if (adv.adventureType == AdventureType.MONSTER) {
            if (rand < 50) {
                myHero.xp = myHero.xp.add(100);
                tokens.awardAdventurer(msg.sender);
            } else {
                myHero.xp = myHero.xp.div(2);
            }
        } else if (adv.adventureType == AdventureType.FRIENDLY) {
            tokens.awardAdventurer(msg.sender);
        } else if (adv.adventureType == AdventureType.ENVIRONMENT) {
            if (rand < 50) {
                myHero.physical = myHero.physical.add(1);
            } else {
                myHero.physical = myHero.physical.sub(1);
            }
        } else if (adv.adventureType == AdventureType.EMPTY) {
            // do nothing
        } else if (adv.adventureType == AdventureType.MENTAL_TRAINING) {
            if (rand < 50) {
                myHero.mental = myHero.mental.add(1);
            }
        } else if (adv.adventureType == AdventureType.PHYSICAL_TRAINING) {
            if (rand < 50) {
                myHero.physical = myHero.physical.add(1);
            }
        }
        myHero.debug = rand;
        myHero.restingTill = uint32(block.timestamp + adventureCoolDown);
        randomNonce = randomNonce.add(1);
        emit AdventureCompleted(
            msg.sender,
            _heroId,
            adv.name,
            adv.adventureType,
            rand
        );
    }
}
